const Email = () => {
    return (
        <div className="emails">
            <h2>Email</h2><br></br>
            <a href="mailto:sopanda0910@gmail.com">sopanda0910@gmail.com</a><br></br>
            <a href="mailto:ompanda0910@gmail.com">ompanda0910@gmail.com</a><br></br>
            <a href="mailto:sopanda25@gmail.com">sopanda25@troyschools.org</a><br></br>
        </div>
    );
}

export default Email;
